  \"An Investigation into the Decline of Great Blue Heron Nestlings at the Seneca
  Pool Colony of Iroquois National Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:05.979429\",\n\t\"name\": \"an-investigation-into-the-decline-of-great-blue-heron-nestlings-at-the-seneca-pool-colony-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"An investigation into the decline of the
  Great Blue Heron's population at Iroquois is the main focus of this research. Specific
  issues such as the possible factors in the decline are also examined. The study
  includes background research on the Great Blue Heron and its nesting patterns, a
  field count to gather data for the 1994 breeding season, analyses of the data at
  hand, and a discussion of possible factors that could be causing the heron's population
  at Iroquois to decline. Through this investigation, the decline at Iroquois is documented
  using data gathered between 1971 and 1993 by the Refuge's staff.\",\n\t\"license_title\":
